const Skills = () => {
  return (
    <div id="skills">
      <div className="hd underline underline-offset-8 decoration-4 lg:ml-64 decoration-yellow-400">
        <h4 className="font-bold">My Skills</h4>
      </div>
      <div ClassName="mb-1 text-base font-medium">Java</div>
      <div ClassName="w-full bg-gray-200 rounded-full h-2.5">
        <div ClassName="bg-gray-600 h-2.5 rounded-full" style="width: 45%"></div>
      </div>
    </div>
  );
};
export default Skills;
